style.css:
@-moz-document domain("nnm-club.name") {
    html body {
        padding-top: 20px !important;
    }
    html body:before {
        content: '';
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: #EEE;
        z-index: 10;
    }
    .request {
        display: none !important;
    }
    noindex {
        display: none;
    }
    .menubot input {
        height: 26px;
        border-radius: 5px;
        padding: 3px 5px;
    }
    .menubot form {
        padding: 4px;
    }
}
